import { Schema, model } from "mongoose";

const ProductSchema = Schema(
  {
    name: String,
    category: String,
    price: Number,
    imgURL: String,
  },
  {
    timestamps: true,
    versionKey: false,
  }
);

export default model("Product", ProductSchema);

